import React from 'react';

function Contributors() {
    const element = (
        <div>
          <h1>Hello!</h1>
          <h2>Good to see you here.</h2>
        </div>
      );
    return (
        <div className="App">
            <header className="App-header">
                <p>
                    Contributors
                </p>
            </header>
        </div>
    );
}

export default Contributors;
